import React from "react";
import ResultsList from "./ResultsList";
import { View, ScrollView, SafeAreaView, StatusBar, Style } from "react-native";

const ResultsListContainer = ({ restaurantList }) => {
  return (
    <SafeAreaView style={styles.container}>
      <ScrollView style={styles.scrollView}>
        <ResultsList
          locationName={restaurantList[0].restaurantName}
          distance={restaurantList[0].distance}
        />
        <ResultsList
          locationName={restaurantList[1].restaurantName}
          distance={restaurantList[1].distance}
        />
        <ResultsList
          locationName={restaurantList[2].restaurantName}
          distance={restaurantList[2].distance}
        />
        <ResultsList
          locationName={restaurantList[3].restaurantName}
          distance={restaurantList[3].distance}
        />
        <ResultsList
          locationName={restaurantList[0].restaurantName}
          distance={restaurantList[0].distance}
        />
        <ResultsList
          locationName={restaurantList[1].restaurantName}
          distance={restaurantList[1].distance}
        />
        <ResultsList
          locationName={restaurantList[2].restaurantName}
          distance={restaurantList[2].distance}
        />
        <ResultsList
          locationName={restaurantList[3].restaurantName}
          distance={restaurantList[3].distance}
        />
        <ResultsList
          locationName={restaurantList[0].restaurantName}
          distance={restaurantList[0].distance}
        />
        <ResultsList
          locationName={restaurantList[1].restaurantName}
          distance={restaurantList[1].distance}
        />
        <ResultsList
          locationName={restaurantList[2].restaurantName}
          distance={restaurantList[2].distance}
        />
        <ResultsList
          locationName={restaurantList[3].restaurantName}
          distance={restaurantList[3].distance}
        />
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingTop: StatusBar.currentHeight,
  },
  scrollView: {
    backgroundColor: "pink",
    marginHorizontal: 20,
  },
});

export default ResultsListContainer;
